description:
Movie Info: John Day is 2013 Hindi thriller film directed by Ahishor Solomon and produced by K Asif, Anjum Rizvi and Aatef A Khan. The film features Naseeruddin Shah, Randeep Hooda, Vipin Sharma, Shernaz Patel as main characters.


